import React from 'react'

const Home = () => {
    return (
        <>
            <div style={{ backgroundColor: "skyblue", height: "87.8vh", justifyContent: "center", alignItems: "center" }} >
                <h1 style={{ padding: "13rem 34rem" }} >Home</h1>
            </div>
        </>
    )
}

export default Home
